import * as React from "react";
import { AppData } from "./appdata";
import Objective from "./objective";
import Summary from "./summary";
import History from "./history";
import Education from "./education";

const Primary = () => {
  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      {/*
      <Objective />
      <Summary />
      <History />
      <Education />
        */}
      <section className="res-objective res-editable" id="Objective">
        <h2 className="note rr poly-wrap poly-0">Objective</h2>
      </section>

      <section className="res-summary res-editable" id="Summary">
        <h2 className="note rr poly-wrap">Summary</h2>
      </section>

      <section className="res-history" id="History">
        <h2 className="note toggle-history-deets rr">
          Professional History <span className="toggle-all"></span>
        </h2>
      </section>

      <section className="res-education res-editable" id="Education">
        <h2 className="note rr poly-wrap">Education</h2>
        <ul className="skewer"></ul>
      </section>
    </React.Fragment>
  );
};

export default Primary;
